import { Col, Row, Skeleton } from "antd";
import "./InternshipPostSkeleton.scss";

const InternshipPostSkeleton = (props) => {
  const { widths } = props;
  return (
    <Row justify="center" align="middle" style={{ height: "100%", width: "100%", padding: "16px" }}>
      <Col {...widths.internshipTitle} className="post__title">
        <Skeleton
          title
          paragraph={{
            rows: 1,
          }}
          active
        />
      </Col>
      <Col {...widths.completitionPeriod} className="post__completitionPeriod">
        <Skeleton
          title
          paragraph={{
            rows: 1,
          }}
          active
        />
      </Col>
      <Col {...widths.totalEnrolled} className="post__enrolled">
        <Skeleton
          paragraph={{
            rows: 1,
          }}
          active
        />
      </Col>
      <Col {...widths.qualifiedCandidates} className="post__candidates">
        <Skeleton
          title
          paragraph={{
            rows: 1,
          }}
          active
        />
      </Col>
      <Col {...widths.icons} className="post__icons">
        <Skeleton
          title
          paragraph={{
            rows: 1,
          }}
          active
        />
      </Col>
    </Row>
  );
};

export default InternshipPostSkeleton;
